import Coin from "./Coin";
//map over coin and create new instances of each coin
//recieves array, maps over array and creates instance?

const Coins = (props) => {
  return (
    <>
      {props.coins.map((coin) => {
        return (
          <Coins
            id={coins.id}
            symbol={coins.symbol}
            marketCap={coins.market_cap}
            coinPerCent={coins.coinpercent}
            coinPrice={coins.current_price}
            image={coins.image}
          />
        );
      })}
    </>
  );
};

export default Coins;
